    false,nt"url": null,nt"notes": "This report describes the survey effort
    on Hagemeister Island in the Alaska Maritime NWR. Hagemeister Island is the second
    largest Bering Sea Island. Reindeer, red foxes and seabirds colonize the island.
    Methods, results and discussion, surveys of seabirds (cormorants, gulls, kittiwakes,
    murres, guillemots, auklets and puffins), marine mammals, raptors, waterfowl, loons
    and grebes, shorebirds, ptarmigan, passerines, beach birds and mammals are described.
    Survey numbers are attached.",nt"license_title": "License Not Specified",nt"extras":
